import { Box, Typography, useTheme } from '@mui/material'
import { ColorModeContext, tokens } from "../../theme";
import MAP1 from 'src/assets/map1.png'
import React, { Component } from "react";
import Slider from "react-slick";
import MOONZ_CAROUSEL from 'src/assets/moonz_carousel.png'
import FULL_CAROUSEL_IMG2 from 'src/assets/full_carousel_img2.jpg'

// Import css files
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import "./centerCarousel.css";

const CenterCarousel = () => {
    const theme = useTheme();
    const colors = tokens(theme.palette.mode);

    const centerSettings = {
        className: "center",
        arrows: false,
        dots: true,
        centerMode: true,
        infinite: true,
        centerPadding: "60px",
        slidesToShow: 3,
        speed: 500,
    };
    return (
        <div>
            <Slider {...centerSettings}>
                <div>
                    <Box className={"center_carousel_item"} >
                        <Box className={"center_carousel_item_img"} >
                            <img src={MOONZ_CAROUSEL} alt="" />
                        </Box>
                    </Box>
                </div>
                <div>
                    <Box className={"center_carousel_item"} >
                        <Box className={"center_carousel_item_img"} >
                            <img src={MOONZ_CAROUSEL} alt="" />
                        </Box>
                    </Box>
                </div>
                <div>
                    <Box className={"center_carousel_item"} >
                        <Box className={"center_carousel_item_img"} >
                            <img src={MOONZ_CAROUSEL} alt="" />
                        </Box>
                    </Box>
                </div>

            </Slider >
        </div >
    )
}

export default CenterCarousel
